import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <button className="Start-button">Start</button> {/* Added Start Button Here */}

        <img src={require('./logo.svg').default} className="App-logo" alt="logo" /> {/* Adjusted src for logo here */}

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>

        <button className="Records-button">Records</button> {/* Added Records Button Here */}

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
